import React from "react";
import "./App.css";
import "./reset.css";

function App() {
  return (
    <div className="wrap">
      <div className="box">
        <div className="boxTop"></div>
        <div className="boxBtn"></div>
        <div className="boxTop"></div>
      </div>
    </div>
  );
}

export default App;
